import React from 'react';
import HelloWorld from './HelloWorld';
import './App.css';

function App() {
  return (
    <div className="App">
     <header className="App-header">
        <h1>Hello, World!</h1>
        <p>Martin Cabello</p>
      </header>
    </div>
  );
}

export default App;
